   return (
       <div>
           <h2> Variables and Constants</h2>
           functionScoped = {functionScoped}<br/>
           blckScoped = {blockScoped} <br/>
           constant = {constant1}<br/>
       </div>
   );
}

export default VariablesAndConstants;
